function debug(msg){console.log(`%cDEBUG: ${msg}`,"color: #2d97cc; font-size:12.5px; font-family:'JetBrains Mono Medium'; font-weight:bolder;")}function warn(msg){console.log(`%cWARNING: ${msg}`,"color: #d6ba3c; font-size:12.5px; font-family:'JetBrains Mono Medium'; font-weight:bolder;")}function info(msg){console.log(`%cINFO: ${msg}`,"color: #3cd687; font-size:12.5px; font-family:'JetBrains Mono Medium'; font-weight:bolder;")}